package ca.ualberta.cs.serl.wikidev.clustering;

public class ClusterPoint {

    private double x;

    private double y;

    public ClusterPoint(double x, double y) {
        this.x = x;
        this.y = y;
    }

    public double getX() {
        return x;
    }

    public void setX(double x) {
        this.x = x;
    }

    public double getY() {
        return y;
    }

    public void setY(double y) {
        this.y = y;
    }
}

